$lightgrey: #e5e5e5;
$grey: #cccccc;

body {
    .fa-youtube {
        color: red;
    }

    .rowmenu{
        height: 60px;
        display: flex;
        justify-content: space-between;

        .menuicon {
            display: flex;
            align-items: center;
            cursor: pointer;
            margin-right: 20px;

            .fa-bars {
                font-size: 20px;
                padding: 12px;
                margin-right: 15px;
                color: #030303;
                &:hover {
                    background-color: $lightgrey;
                    border-radius: 50%;
                }
            }

            .fa-youtube {
                font-size: 30px;
                margin-right: 5px;
            }

            span {
                font-size: 20px;
                font-weight: lighter;
                font-family: fantasy;
            }
        }

        .search {
            display: flex;
            align-items: center;
            width: 400px; 
            .search-input {             
                flex-basis: 40px; 
                flex-grow: 1;
                flex-shrink: 1;
                display: flex;
                align-items: center;
                justify-content: center;

                .search-left {
                    display: flex;
                    width: 20px;
                    height: 42px;
                    border-top: solid 1px $grey;
                    border-left: solid 1px $grey;
                    border-bottom: solid 1px $grey;  
                    border-radius: 20px 0 0 20px;

                    .fa-magnifying-glass {
                        font-size: 14px;
                        margin: auto;
                        display: none;
                    }
                }

                &:focus-within  {
                    .fa-magnifying-glass {
                        display: inline-block;
                        text-align: center;
                    }
                    
                    .search-left {
                        border-color: #1c62b9;
                        width: 50px;
                    }
                }

                input {
                    display: flex;
                    flex-basis: 20px; 
                    flex-grow: 1;
                    flex-shrink: 1;
                    max-width: 360px;
                    height: 40px;
                    border-top: solid 1px $grey;
                    border-right: solid 1px $grey;
                    border-bottom: solid 1px $grey;
                    border-left: none;
                    color: #888888;
                    font-size: 16px;
    
                    &:focus {
                        border-color: #1c62b9;
                    }
                }   
            }

            button {
                width: 60px;
                height: 44px;
                border-top: solid 1px $grey;
                border-right: solid 1px $grey;
                border-bottom: solid 1px $grey;
                background-color: #f8f8f8;
                border-radius: 0 20px 20px 0;

                .fa-magnifying-glass {
                    font-size: 17px;
                }
            }

            button:hover {
                background-color: #f0f0f0;
            }

            
        }


        .more {
            display: flex;
            align-items: center;

            .fa-ellipsis-vertical {
                padding: 14px;
                margin: auto 10px;
                cursor: pointer;
            }

            button {
                display: flex;
                width: 90px;
                height: 36px;
                border: solid 1px #e5e5e5;
                background-color: #ffffff;
                color: rgb(94, 118, 255);
                border-radius: 20px;
                margin-right: 20px;
                font-size: 14px;
                font-weight: lighter;
                align-items: center;
                justify-content: space-around;

                .fa-circle-user {
                    font-size: 20px;
                    margin-right: 5px;
                  }
              }

              button:hover {
                background-color: #def1ff;
              }
        }
    }
    .colmenu {
        display: flex;
        flex-direction: column;
        width: 200px;
        $height: calc(100vh - 70px);
        height: $height;
        overflow-y: scroll;

        &::-webkit-scrollbar {
            background-color: inherit;
        }
        &::-webkit-scrollbar-thumb {
            background-color: #dadada; /* 스크롤바 막대 색상 */
            border: 4px solid #ffffff; /* 스크롤바 막대 테두리 설정  */
            border-radius: 12px 12px 12px 12px;
        }
        &::-webkit-scrollbar-track {
            background-color: #ffffff; /* 스크롤바 뒷 배경 색상 */
        }

        .main, .user, .subscribe, .search, .more, .setting {
            margin-top: 10px;
            margin-left: 10px;
            div {
                height: 40px;
                font-size: 18px;
                display: flex;
                align-items: center;
                cursor: pointer;
                &:hover {
                    background-color: $lightgrey;
                    border-radius: 7px;
                }
                span{
                    margin-left: 10px;
                    margin-right: 10px;
                }
                .fa-chevron-right {
                    font-size: 12px;
                    
                }
            }
            ul {
                list-style:none;
                padding-left: 0px;
                margin-top: 0px;
                @for $i from 1 through 10 {
                    li:nth-child(#{$i}) {
                        display: flex;
                        align-items: center;
                        height: 30px;
                        padding-top: 5px;
                        padding-bottom: 5px;
                        cursor: pointer;
                        
                        &:hover {
                            background-color: $lightgrey;
                            border-radius: 7px;
                        }
                        i {
                            margin-left: 10px;
                        }
                        span {
                            margin-left: 20px;
                            overflow: hidden;
                            text-overflow: ellipsis;
                            white-space: nowrap;
                            font-size: 15px;
                        }
                    }
                }
            }
            border-bottom: 1px solid $lightgrey;
        }

        
    }
}

button {
    border: 0;
    outline: 0;
    cursor: pointer;
}
  
input {
    outline-style: none;
}
